    create table Advertisement_preferredIntervals (
        Advertisement_id bigint not null,
        preferredIntervals binary(255)
    );

    create table Offer_intervals (
        Offer_id bigint not null,
        intervals binary(255)
    );

    create table advertisement (
        id bigint generated by default as identity unique,
        other varchar(255),
        dateCreated timestamp not null,
        uuid varchar(255) not null,
        description varchar(2000) not null,
        homeJob boolean not null,
        maxOffer integer not null check (maxOffer>=1),
        remuneration varchar(255) not null,
        settlement_id bigint,
        category_id bigint not null,
        user_id bigint not null,
        primary key (id)
    );

    create table conversation (
        id bigint generated by default as identity unique,
        advertisement_id bigint,
        user1_id bigint not null,
        user2_id bigint not null,
        primary key (id)
    );

    create table help (
        id bigint generated by default as identity unique,
        category varchar(255) not null,
        message varchar(255) not null,
        subject varchar(255) not null,
        user_id bigint,
        primary key (id)
    );

    create table jobcategory (
        id bigint generated by default as identity unique,
        main boolean not null,
        name varchar(255),
        main_id bigint,
        primary key (id)
    );

    create table message (
        id bigint generated by default as identity unique,
        dateCreated timestamp not null,
        text varchar(255) not null,
        conversation_id bigint not null,
        recipient_id bigint not null,
        sender_id bigint not null,
        primary key (id)
    );

    create table offer (
        id bigint generated by default as identity unique,
        amount decimal(19,2) not null,
        advertisement_id bigint not null,
        user_id bigint not null,
        primary key (id)
    );

    create table rating (
        id bigint generated by default as identity unique,
        value double not null check (value<=10),
        ratedUser_id bigint,
        raterUser_id bigint not null,
        skill_id bigint not null,
        primary key (id)
    );

    create table settlement (
        id bigint generated by default as identity unique,
        settlement varchar(255),
        zipcode integer,
        primary key (id)
    );

    create table skill (
        id bigint generated by default as identity unique,
        name varchar(255) not null,
        question varchar(255) not null,
        primary key (id)
    );

    create table user (
        id bigint generated by default as identity unique,
        other varchar(255),
        firstLogin boolean not null,
        lastLogin timestamp,
        password varchar(255) not null,
        active boolean not null,
        addressCard varchar(255),
        email varchar(255),
        firstName varchar(255),
        idCard varchar(255),
        introduction varchar(255),
        lastName varchar(255),
        phoneNumber varchar(255),
        registrationDate timestamp,
        username varchar(255) not null,
        settlement_id bigint,
        primary key (id)
    );

    create table user_advertisement (
        user_id bigint not null,
        savedAds_id bigint not null,
        primary key (user_id, savedAds_id),
        unique (savedAds_id)
    );

    create table valueset (
        id bigint generated by default as identity unique,
        name varchar(255) not null,
        primary key (id)
    );

    create table valuesetentry (
        id bigint generated by default as identity unique,
        bkey varchar(255) not null,
        valueSet_id bigint not null,
        primary key (id)
    );

    create table valuestore (
        id bigint generated by default as identity unique,
        name varchar(255) not null,
        value varchar(255) not null,
        primary key (id)
    );

